//import logo from './logo.svg';
import './css/App.css';

import Navbar from './Navbar';
import SelfInfo from './SelfInfo';
import Skills from './Skills';
import Works from './Works';
import Footer from "./Footer"

function App() {

  return (
    <div className="App">
      <Navbar />

      <div id="self"></div>

      <SelfInfo/>

      <div id="skill"></div>

      <Skills/>

      <div id="work"></div>

      <Works/>




    <footer/>

    </div>
  );
}

export default App;
